import React from "react";
import "./assets/main.css";
import Container from "./components/Container/Container";

const App = () => {
  var ws = new WebSocket("ws://localhost:8080/websocket");
  ws.onopen(()=>{console.log("connection established!")}); 
  ws.send();

  return (
    <div className="App">
      <Container />
    </div>
  );
};

export default App;
